import "./Landing.css";

class Landing extends Component {
  render() {
    return (
        
            <img src="https://images.unsplash.com/photo-1534497977663-a73dfabd7774?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjEyMDd9&s=2ffa16299d8b0a0b021cde843304374d&w=1000&q=80" className="img-fluid" alt="Responsive image">
        </img>
    );
  }
}

export default Landing;
